    it('should return undefined if the start node does not exist', () => {
        const graph = new MultiDirectedGraph<NodeAttributes, EdgeAttributes, GraphAttributes>();
        graph.addNode('A', { x: 0, y: 0, type: MiscNodeType.Virtual, visible: true, zIndex: 0, virtual: {} });
        const result = findShortestClosedPath(graph, 'B' as MiscNodeId);
        expect(result).toBeUndefined();
    });

    it('should find a simple triangular closed path', () => {
        const graph = new MultiDirectedGraph<NodeAttributes, EdgeAttributes, GraphAttributes>();
        graph.addNode('A', { x: 0, y: 0, type: MiscNodeType.Virtual, visible: true, zIndex: 0, virtual: {} });
        graph.addNode('B', { x: 1, y: 0, type: MiscNodeType.Virtual, visible: true, zIndex: 0, virtual: {} });
        graph.addNode('C', { x: 0, y: 1, type: MiscNodeType.Virtual, visible: true, zIndex: 0, virtual: {} });
        graph.addDirectedEdgeWithKey('e1', 'A', 'B');
        graph.addDirectedEdgeWithKey('e2', 'B', 'C');
        graph.addDirectedEdgeWithKey('e3', 'C', 'A');

        const result = findShortestClosedPath(graph, 'A' as MiscNodeId);
        expect(result).toBeDefined();
        expect(result?.nodes).toEqual(['A', 'B', 'C', 'A']);
        expect(result?.edges).toEqual(['e1', 'e2', 'e3']);
    });

    it('should return undefined when no closed path exists', () => {
        const graph = new MultiDirectedGraph<NodeAttributes, EdgeAttributes, GraphAttributes>();
        graph.addNode('A', { x: 0, y: 0, type: MiscNodeType.Virtual, visible: true, zIndex: 0, virtual: {} });
        graph.addNode('B', { x: 1, y: 0, type: MiscNodeType.Virtual, visible: true, zIndex: 0, virtual: {} });
        graph.addNode('C', { x: 0, y: 1, type: MiscNodeType.Virtual, visible: true, zIndex: 0, virtual: {} });
        graph.addDirectedEdgeWithKey('e1', 'A', 'B');
        graph.addDirectedEdgeWithKey('e2', 'B', 'C');

        const result = findShortestClosedPath(graph, 'A' as MiscNodeId);
        expect(result).toBeUndefined();
    });

    it('should find the shorter of two possible closed paths', () => {
        const graph = new MultiDirectedGraph<NodeAttributes, EdgeAttributes, GraphAttributes>();
        ['A', 'B', 'C', 'D', 'E'].forEach(n =>
            graph.addNode(n, { x: 0, y: 0, type: MiscNodeType.Virtual, visible: true, zIndex: 0, virtual: {} })
        );
        // Shorter path (length 4)
        graph.addDirectedEdgeWithKey('e_ab', 'A', 'B');
        graph.addDirectedEdgeWithKey('e_bc', 'B', 'C');
        graph.addDirectedEdgeWithKey('e_ca', 'C', 'A');
        // Longer path (length 5)
        graph.addDirectedEdgeWithKey('e_ad', 'A', 'D');
        graph.addDirectedEdgeWithKey('e_de', 'D', 'E');
        graph.addDirectedEdgeWithKey('e_ea', 'E', 'A');

        const result = findShortestClosedPath(graph, 'A' as MiscNodeId);
        expect(result).toBeDefined();
        expect(result?.nodes).toEqual(['A', 'B', 'C', 'A']);
        expect(result?.edges).toEqual(['e_ab', 'e_bc', 'e_ca']);
    });

    it('should return undefined if the only closed path is longer than maxNodes', () => {
        const graph = new MultiDirectedGraph<NodeAttributes, EdgeAttributes, GraphAttributes>();
        ['A', 'B', 'C', 'D'].forEach(n =>
            graph.addNode(n, { x: 0, y: 0, type: MiscNodeType.Virtual, visible: true, zIndex: 0, virtual: {} })
        );
        graph.addDirectedEdgeWithKey('e1', 'A', 'B');
        graph.addDirectedEdgeWithKey('e2', 'B', 'C');
        graph.addDirectedEdgeWithKey('e3', 'C', 'D');
        graph.addDirectedEdgeWithKey('e4', 'D', 'A');

        // Path is A->B->C->D->A, which has 5 nodes. maxNodes=4 should fail.
        const result = findShortestClosedPath(graph, 'A' as MiscNodeId, 4);
        expect(result).toBeUndefined();
    });

    it('should correctly find a path when its length is equal to maxNodes', () => {
        const graph = new MultiDirectedGraph<NodeAttributes, EdgeAttributes, GraphAttributes>();
        ['A', 'B', 'C', 'D'].forEach(n =>
            graph.addNode(n, { x: 0, y: 0, type: MiscNodeType.Virtual, visible: true, zIndex: 0, virtual: {} })
        );
        graph.addDirectedEdgeWithKey('e1', 'A', 'B');
        graph.addDirectedEdgeWithKey('e2', 'B', 'C');
        graph.addDirectedEdgeWithKey('e3', 'C', 'D');
        graph.addDirectedEdgeWithKey('e4', 'D', 'A');

        // Path is A->B->C->D->A, which has 5 nodes. maxNodes=5 should succeed.
        const result = findShortestClosedPath(graph, 'A' as MiscNodeId, 5);
        expect(result).toBeDefined();
        expect(result?.nodes).toEqual(['A', 'B', 'C', 'D', 'A']);
    });

    it('should ignore self-loops on the start node and find a valid path', () => {
        const graph = new MultiDirectedGraph<NodeAttributes, EdgeAttributes, GraphAttributes>();
        ['A', 'B', 'C'].forEach(n =>
            graph.addNode(n, { x: 0, y: 0, type: MiscNodeType.Virtual, visible: true, zIndex: 0, virtual: {} })
        );
        graph.addDirectedEdgeWithKey('e_self', 'A', 'A'); // Self-loop
        graph.addDirectedEdgeWithKey('e_ab', 'A', 'B');
        graph.addDirectedEdgeWithKey('e_bc', 'B', 'C');
        graph.addDirectedEdgeWithKey('e_ca', 'C', 'A');

        const result = findShortestClosedPath(graph, 'A' as MiscNodeId);
        expect(result).toBeDefined();
        expect(result?.nodes).toEqual(['A', 'B', 'C', 'A']);
        expect(result?.edges).not.toContain('e_self');
    });

    it('should handle dead-end branches and still find the correct path', () => {
        const graph = new MultiDirectedGraph<NodeAttributes, EdgeAttributes, GraphAttributes>();
        ['A', 'B', 'C', 'X', 'Y'].forEach(n =>
            graph.addNode(n, { x: 0, y: 0, type: MiscNodeType.Virtual, visible: true, zIndex: 0, virtual: {} })
        );
        // Correct path
        graph.addDirectedEdgeWithKey('e_ab', 'A', 'B');
        graph.addDirectedEdgeWithKey('e_bc', 'B', 'C');
        graph.addDirectedEdgeWithKey('e_ca', 'C', 'A');
        // Dead-end branch
        graph.addDirectedEdgeWithKey('e_ax', 'A', 'X');
        graph.addDirectedEdgeWithKey('e_xy', 'X', 'Y');

        const result = findShortestClosedPath(graph, 'A' as MiscNodeId);
        expect(result).toBeDefined();
        expect(result?.nodes).toEqual(['A', 'B', 'C', 'A']);
    });

    it('should handle multiple edges between nodes and pick the one that forms the shortest path', () => {
        const graph = new MultiDirectedGraph<NodeAttributes, EdgeAttributes, GraphAttributes>();
        ['A', 'B', 'C'].forEach(n =>
            graph.addNode(n, { x: 0, y: 0, type: MiscNodeType.Virtual, visible: true, zIndex: 0, virtual: {} })
        );
        graph.addDirectedEdgeWithKey('e_ab', 'A', 'B');
        graph.addDirectedEdgeWithKey('e_bc', 'B', 'C');
        // Two ways to get back to A from C
        graph.addDirectedEdgeWithKey('e_ca_short', 'C', 'A');
        graph.addDirectedEdgeWithKey('e_ca_long', 'C', 'A');

        const result = findShortestClosedPath(graph, 'A' as MiscNodeId);
        expect(result).toBeDefined();
        expect(result?.nodes).toEqual(['A', 'B', 'C', 'A']);
        // The algorithm is BFS-based, so it's not guaranteed which edge it finds first if they are at the same depth.
        // The important part is that it finds a valid shortest path.
        expect(result?.edges).toContain('e_ab');
        expect(result?.edges).toContain('e_bc');
        expect(['e_ca_short', 'e_ca_long']).toContain(result?.edges[2]);
    });
